// src/components/DisplayEmployee.js
import React from 'react';

function DisplayEmployee({ employee: objEmploye }) {
  return (
    <div className="DisplayEmployee">
      <img
        src={objEmploye.picture.medium}
        alt={objEmploye.name.first}
      />
      <ul>
        <li>Gender: {objEmploye.gender}</li>
        <li>
          Name: {objEmploye.name.title}{' '}
          {objEmploye.name.last}{' '}
          {objEmploye.name.first}
        </li>
        <li>E-mail: {objEmploye.email}</li>
        <li>
          Location: {objEmploye.location.street.number}{' '}
          {objEmploye.location.street.name},{' '}
          {objEmploye.location.postcode} {objEmploye.location.city}
        </li>
      </ul>
    </div>
  );
};

export default DisplayEmployee;
